import { ChannelIMage, Component, ImageBanner, TitleCOntainer } from "./styles"


const VideoComponent = () => {
  return (
    <Component>
      <ImageBanner src="https://i.ytimg.com/vi/PFQgajrcPeU/hq720_live.jpg" />
      <TitleCOntainer>
        <ChannelIMage>
          LP
        </ChannelIMage>
      </TitleCOntainer>
    </Component>
  )
}

export default VideoComponent;
